import { Injectable } from '@angular/core';
import { Priapisme } from '../models/Priapisme';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class PriapismeService {

 
  private apiUrl = 'https://localhost:7129/api/Priapismes';

  constructor(private http: HttpClient) { }
  addpriapisme(Priapisme: Priapisme): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', Priapisme);

    return this.http.post<any>(`${this.apiUrl}/addpriapisme`, Priapisme, { observe: 'response' });
  }}
